import React from 'react';

function Whatsapi() {
    return (
        <div className="fb-page shadow" data-href="https://www.facebook.com/PJDGO" data-tabs="timeline"
        align="center" data-width="500" data-height="450" data-small-header="true"
        data-adapt-container-width="true" data-hide-cover="false" data-show-facepile="true">
        <blockquote cite="https://www.facebook.com/PJDGO" className="fb-xfbml-parse-ignore"></blockquote>
    </div>
    );
}

export default Whatsapi;
